import MSFTContextMenu from "./context-menu";
import contextMenuSchema from "./context-menu.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { ContextMenuStyles } from "@microsoft/fast-components-styles-msft";
/* tslint:disable-next-line:typedef */
const ContextMenu = manageJss(ContextMenuStyles)(MSFTContextMenu);
export { ContextMenu, contextMenuSchema, };
